#include "../matrix_lib/matrix_lib.h"
#include <gtest/gtest.h>

TEST(TestDiv, basic) {
    matrix_lib::Matrix left;
    double right;
    matrix_lib::Matrix result;

    left = matrix_lib::Matrix{{-36, -26},
                              {-27, -14}};
    right = -11;
    result = matrix_lib::Matrix{{3.272727272727273,  2.3636363636363638},
                                {2.4545454545454546, 1.2727272727272727}};
    EXPECT_EQ(left / right, result);

    left = matrix_lib::Matrix{{-3, 5},
                              {13, 29}};
    right = 31;
    result = matrix_lib::Matrix{{-0.0967741935483871, 0.16129032258064516},
                                {0.41935483870967744, 0.9354838709677419}};
    EXPECT_EQ(left / right, result);

    left = matrix_lib::Matrix{{-6, -13},
                              {-3, 32}};
    right = -29;
    result = matrix_lib::Matrix{{0.20689655172413793, 0.4482758620689655},
                                {0.10344827586206896, -1.103448275862069}};
    EXPECT_EQ(left / right, result);

    left = matrix_lib::Matrix{{-36, 43},
                              {10,  18}};
    right = 12;
    result = matrix_lib::Matrix{{-3.0,               3.5833333333333335},
                                {0.8333333333333334, 1.5}};
    EXPECT_EQ(left / right, result);

    left = matrix_lib::Matrix{{-32, -11},
                              {-24, 19}};
    right = -48;
    result = matrix_lib::Matrix{{0.6666666666666666, 0.22916666666666666},
                                {0.5,                -0.3958333333333333}};
    EXPECT_EQ(left / right, result);

    left = matrix_lib::Matrix{{5, 35},
                              {3, -26}};
    right = -47;
    result = matrix_lib::Matrix{{-0.10638297872340426, -0.7446808510638298},
                                {-0.06382978723404255, 0.5531914893617021}};
    EXPECT_EQ(left / right, result);

    left = matrix_lib::Matrix{{41, 41},
                              {8,  -1}};
    right = -25;
    result = matrix_lib::Matrix{{-1.64, -1.64},
                                {-0.32, 0.04}};
    EXPECT_EQ(left / right, result);

    left = matrix_lib::Matrix{{-7,  5},
                              {-36, -50}};
    right = -26;
    result = matrix_lib::Matrix{{0.2692307692307692, -0.19230769230769232},
                                {1.3846153846153846, 1.9230769230769231}};
    EXPECT_EQ(left / right, result);

    left = matrix_lib::Matrix{{-23, -10},
                              {47,  -39}};
    right = 12;
    result = matrix_lib::Matrix{{-1.9166666666666667, -0.8333333333333334},
                                {3.9166666666666665,  -3.25}};
    EXPECT_EQ(left / right, result);

    left = matrix_lib::Matrix{{7,  31},
                              {45, -43}};
    right = -34;
    result = matrix_lib::Matrix{{-0.20588235294117646, -0.9117647058823529},
                                {-1.3235294117647058,  1.2647058823529411}};
    EXPECT_EQ(left / right, result);
}

