TEST(TestDiv, divideByZero) {
    matrix_lib::Matrix left;
    left = matrix_lib::Matrix{{31, -18},
                              {3,  17}};
    EXPECT_THROW(left / 0, std::overflow_error);

    left = matrix_lib::Matrix{{42, 15},
                              {48, -49}};
    EXPECT_THROW(left / 0, std::overflow_error);

    left = matrix_lib::Matrix{{3,  -14},
                              {-3, 38}};
    EXPECT_THROW(left / 0, std::overflow_error);

    left = matrix_lib::Matrix{{-49, -35},
                              {6,   -24}};
    EXPECT_THROW(left / 0, std::overflow_error);

    left = matrix_lib::Matrix{{40,  -49},
                              {-28, -27}};
    EXPECT_THROW(left / 0, std::overflow_error);
}
